 * (To see them, uncomment and save)
 */
.tree-view-resizer {
  max-width: 120px;
}
.editor .gutter .line-number {
  padding: 0 0 0 0;
}
.editor .gutter .line-number .icon-right {
  padding: 0;
}
.tab-bar {
  height: 34px;
  padding: 0;
}
.tab-bar .tab {
  -webkit-transform: none;
  top: 2px;
  line-height: 25px;
}
.tab-bar .tab.active {
  height: 25px;
}
.tab-bar .tab.active:before {
  height: 25px;
}
.tab-bar .tab:before {
  -webkit-transform: none;
  width: 18px;
}
.tab-bar .tab .close-icon {
  -webkit-transform: none;
  line-height: 25px;
}
.tab-bar .tab .title {
  -webkit-transform: none;
}
